BlockWorld项目会设计一个代币BOWT。BOWT是ERC-20代币，代表了项目运营的收益。不论项目在用何种机器挖的任何币种，或是项目从其他业务获得的收益，都会用BOWT的形式发放。','0','1','0','0','zh-cn');
投资算力是你可以选择的稳健性数字货币投资方式。<br />
本项目不仅会投资算力基础设施，同时会投资算力，为投资者提供稳健的数字货币投资选择。','0','1','0','0','zh-cn');
一部分的算力也可以用于云挖矿算力出租。这部分意味着投资的瞬间回本，但是收益是不及自主挖矿。项目适当考虑这部分的市场是为了更好的风险控制。<br />
挖&nbsp; 矿<br />
